import React from 'react';

import './Footer.scss';

class Footer extends React.Component{
  render() {
    return(
      <React.Fragment>
        <footer>
        <p className="footer__texto">Made by Squad 2</p>
        </footer>
      </React.Fragment>
    )
  } 
}    

export default Footer;
